import perfilImage from "../../assets/images/AriCV.jpg";

const PerfilCV = () => {
  return (
    <article>
      <section>
        <h3>PERFIL</h3>
        <p>
          Piel: Mediterránea. Estatura: 1’65 cm. Peso: 50 kg. Pelo: Castaño
          Ojos: Castaños Medidas: 87-64-95 Edad: 25-35 Residencia: Madrid,
          Galicia Idiomas Castellano y Gallego: Lengua Materna. Inglés:
          Bilingüe. Portugués, Francés, Italiano: Nivel Medio. Alemán, Ruso:
          Básico. Facilidad para todo tipo de acentos. Neutro, Gallego, Andaluz,
          Internacionales... Aptitudes: Canto (Soprano), Guitarra, Percusión,
          Locución, Danza, Equitación, Lengua de Signos, Esquí, Zancos, Esgrima,
          Lucha Escénica, Manejo de Armas, Mimo, Clown, Yoga, Carnet B1
        </p>
      </section>
      <img src={perfilImage} alt="Ariadna Santana" />
    </article>
  );
};
export default PerfilCV;
